295    private var bottomButtons: some View {
296        VStack(spacing: 12) {
297            switch step {
298            case .create:
299                Button("Clear") {
300                    patternState.reset()
301                    validationResult = nil
302                }
303                .disabled(patternState.selectedNodes.isEmpty)
304                .accessibilityIdentifier("pattern_clear")
305
306            case .confirm:
307                Button("Start Over") {
308                    step = .create
309                    firstPattern = []
310                    patternState.reset()
311                    validationResult = nil
312                }
313                .accessibilityIdentifier("pattern_start_over")
314
315            case .recovery:
316                Button(action: {
317                    showSaveConfirmation = true
318                }) {
319                    Text("I've saved it")
320                        .font(.headline)
321                        .frame(maxWidth: .infinity)
322                        .padding()
323                }
324                .vaultProminentButtonStyle()
325                .disabled(useCustomPhrase && !(customPhraseValidation?.isAcceptable ?? false))
326                .accessibilityIdentifier("recovery_saved")
327                .alert("Are you sure?", isPresented: $showSaveConfirmation) {
328                    Button("Cancel", role: .cancel) {
329                        // No-op: dismiss handled by SwiftUI
330                    }
331                    Button("Yes, I've saved it") {
332                        if useCustomPhrase {
333                            // For custom phrases, the phrase was already saved during pattern creation.
334                            // We just need to complete the flow.
335                            onComplete()
336                        } else {
337                            onComplete()
338                        }
339                    }
340                } message: {
341                    Text("This recovery phrase will NEVER be shown again. Make sure you've written it down and stored it safely.")
342                }
343            }
344        }
345    }
