347    // MARK: - Actions
348
349    private func handlePatternComplete(_ pattern: [Int]) {
350        patternSetupLogger.debug("Pattern completed in \(String(describing: step), privacy: .public) step, count: \(pattern.count)")
351        
352        switch step {
353        case .create:
354            let result = PatternValidator.shared.validate(pattern, gridSize: patternState.gridSize)
355            validationResult = result
356
357            patternSetupLogger.debug("Validation: isValid=\(result.isValid), errors=\(result.errors.count), warnings=\(result.warnings.count)")
358
359            if result.isValid {
360                UINotificationFeedbackGenerator().notificationOccurred(.success)
361                errorMessage = nil
362                firstPattern = pattern
363                step = .confirm
364                patternState.reset()
365
366                patternSetupLogger.debug("Pattern valid, moving to confirm step")
367            } else {
368                patternSetupLogger.debug("Pattern invalid, resetting")
369                patternState.reset()
370            }
371
372        case .confirm:
373            patternSetupLogger.debug("Confirming pattern, match=\(pattern == firstPattern)")
374            
375            if pattern == firstPattern {
376                // Patterns match - save and continue
377                UINotificationFeedbackGenerator().notificationOccurred(.success)
378                errorMessage = nil
379                patternSetupLogger.debug("Patterns match, saving")
380                // Generate the phrase now, before saving
381                if !useCustomPhrase {
382                    generatedPhrase = RecoveryPhraseGenerator.shared.generatePhrase()
383                }
384                savePattern(pattern)
385            } else {
386                // Patterns don't match - show error and reset
387                UINotificationFeedbackGenerator().notificationOccurred(.error)
388                patternSetupLogger.debug("Patterns don't match, resetting")
389                errorMessage = "Patterns don't match. Try again."
390                patternState.reset()
391                Task {
392                    try? await Task.sleep(nanoseconds: 2_500_000_000)
393                    await MainActor.run { errorMessage = nil }
394                }
395            }
396
397        default:
398            break
399        }
400    }
401
402    private func savePattern(_ pattern: [Int]) {
403        patternSetupLogger.debug("Saving pattern, gridSize=\(patternState.gridSize)")
404        isSaving = true
405
406        Task {
407            let phrase = useCustomPhrase ? customPhrase.trimmingCharacters(in: .whitespacesAndNewlines) : generatedPhrase
408            let result = await coordinator.savePattern(pattern, gridSize: patternState.gridSize, phrase: phrase)
409
410            await MainActor.run {
411                switch result {
412                case .success(let key):
413                    patternSetupLogger.debug("Pattern saved successfully")
414                    EmbraceManager.shared.addBreadcrumb(category: "onboarding.complete", data: ["gridSize": patternState.gridSize])
415
416                    isSaving = false
417                    appState.currentVaultKey = VaultKey(key)
418                    let letters = GridLetterManager.shared.vaultName(for: pattern)
419                    appState.updateVaultName(letters.isEmpty ? "Vault" : "Vault \(letters)")
420                    step = .recovery
421
422                case .duplicatePattern:
423                    patternSetupLogger.info("Vault already exists for this pattern")
424                    isSaving = false
425                    step = .create
426                    patternState.reset()
427                    firstPattern = []
428                    validationResult = PatternValidationResult(
429                        isValid: false,
430                        errors: [.custom("This pattern is already used by another vault. Please choose a different pattern.")],
431                        warnings: [],
432                        metrics: PatternSerializer.PatternMetrics(
433                            nodeCount: pattern.count,
434                            directionChanges: 0,
435                            startsAtCorner: (Set(pattern).count != 0),
436                            endsAtCorner: false,
437                            crossesCenter: false,
438                            touchesAllQuadrants: false
439                        )
440                    )
441
442                case .error(let message):
443                    patternSetupLogger.error("Error saving pattern: \(message, privacy: .public)")
444                    isSaving = false
445                    errorMessage = "Failed to save pattern. Please try again."
446                    step = .create
447                    patternState.reset()
448                    firstPattern = []
449                }
450            }
451        }
452    }
453    
454    private func saveCustomRecoveryPhrase() {
455        guard let key = appState.currentVaultKey else { return }
456        isSaving = true
457
458        Task {
459            let phrase = customPhrase.trimmingCharacters(in: .whitespacesAndNewlines)
460            let result = await coordinator.saveCustomPhrase(phrase, pattern: firstPattern, gridSize: patternState.gridSize, key: key.rawBytes)
461
462            await MainActor.run {
463                isSaving = false
464                switch result {
465                case .success:
466                    onComplete()
467                case .duplicatePattern:
468                    break // Not possible for custom phrase path
469                case .error(let message):
470                    patternSetupLogger.error("Failed to save custom phrase: \(message, privacy: .public)")
471                    errorMessage = "Failed to save recovery phrase. Please try again."
472                }
473            }
474        }
475    }
476
477    private func validateCustomPhrase(_ phrase: String) {
478        guard !phrase.isEmpty else {
479            customPhraseValidation = nil
480            return
481        }
482        customPhraseValidation = RecoveryPhraseGenerator.shared.validatePhrase(phrase)
483    }
484
485    private func dismissKeyboard() {
486        UIApplication.shared.sendAction(
487            #selector(UIResponder.resignFirstResponder),
488            to: nil,
489            from: nil,
490            for: nil
491        )
492    }
493}
